        new OpenAPIMetadata() { Signature = "VedAstro.Library.Calculate.Shashtiamsa PlanetShadbalaPinda(PlanetName planetName, Time time)", Description = " THE FINAL TOTAL STRENGTH Shadbala the six sources of strength and weakness the planets The importance of and the part played by the Shadbalas in the science of horoscopy are manifold In order to obtain the total strength of the Shadbala Pinda of each planet we have to add together its Sthana Bala Dik Bala Kala Bala. Chesta Bala and Naisargika Bala. And the Grahas Drik Bala must be added to or subtracted from the above sum according as it is positive or negative. The result obtained is the Shadbala Pinda of the planet in Shashtiamsas. Note Rahu Ketu supported via house lord ", ExampleOutput = "{ 'PlanetShadbalaPinda': '425.7'}" },
        new OpenAPIMetadata() { Signature = "VedAstro.Library.Calculate.Shashtiamsa PlanetStrength(PlanetName planetName, Time time)", Description = " get total combined strength of the inputed planet input birth time to get strength in horoscope note an alias method to GetPlanetShadbalaPinda strength is easier to remember ", ExampleOutput = "{ 'PlanetStrength': '425.7'}" },
        new OpenAPIMetadata() { Signature = "VedAstro.Library.Calculate.Shashtiamsa PlanetDrikBala(PlanetName planetName, Time time)", Description = " Aspect strength This strength is gained by the virtue of the aspect Graha Dristi of different planets on other planet. The aspect of benefics is considered to be strength and the aspect of malefics is considered to be weaknesses. Drik Bala.This means aspect strength. The Drik Bala of a Gqaha is onefourth of the Drishti Pinda on it. It is positive or negative according as the Drishti Pinda is positive or negative. See the formula given on page 85. There is special aspect for Jupiter Mars and Saturn on the 5th and 9th 4th and 8th and 3rd and 10th signs respectively. ", ExampleOutput = "{ 'PlanetDrikBala': '15.859965277777775'}" },
